skip-auth-prefixes:
- 127.0.0.1/8
- 192.168.0.1/16
- ::1/128
sniffer:
  enable: true
  force-domain: []
  parse-pure-ip: true
  skip-domain:
  - Mijia Cloud
  sniff:
    HTTP:
      override-destination: true
      ports:
      - 80
      - 8080-8880
    QUIC:
      ports:
      - 443
      - 8443
    TLS:
      ports:
      - 443
      - 8443
tcp-concurrent: true
unified-delay: true
